updateShot.body:
var heroX=hero[0];
var heroY=hero[1];
var mouseX=mouse[0];
var mouseY=mouse[1];

var alpha;
var a;
//var a=(mouseY*0.5 - heroY)/(mouseX - heroX);

//var b=heroY - a*heroX;

lasers = RW.cloneData(lasers);
for(var key in lasers) { 
    var laser = lasers[key]; 
    if(laser[0] < screenSize[0]) {
        a=(mouseY-laser[1])/(20);
        alpha=Math.atan(a);
        alpha=alpha*0.3;
        laser[0] = laser[0] + 20;
        laser[1] = laser[1] + 20*Math.tan(alpha);
    }
    else delete lasers[key]; 
}
return lasers;

