updateStarfield.body:
var stars = []; 
for(var i = 0; i < starfield.length; i++) { 
    var star = starfield[i]; 
    if(star.position[0] < 0) {
        stars.push({ 
            position: [screenSize[0], Math.random() * screenSize[1]],
            velocity: star.velocity
        });
    }
    else { 
        stars.push({ position: [star.position[0] - star.velocity, star.position[1]], velocity: star.velocity }); 
    } 
}
return stars;

computeDistanceFromMouse.body:
var vec = [];
vec[0] = Math.abs(mousePosition[0] - (position[0] + assetSize[0]/2));
vec[1] = Math.abs(mousePosition[1] - (position[1] + assetSize[1]/2));

var result = vec[0]*vec[0] + vec[1]*vec[1];
return result;
